import React from 'react';
import './App.css';
import HomeScreen from './components/HomescreenComponent/HomeScreen';
import Login from './components/LoginComponent/Login'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {

  const user = null;


  return (
    <div className="app">


      <Router>

        {!user ? (
          <Login />

        ) : (
          <Switch>
            <Route exact path="/">
                {/*Home Screen*/}
                <HomeScreen />
            </Route>
          </Switch>
        )


        }



      </Router>
    </div>
  );
}

export default App;
